<script>
import axios from 'axios';
export default {
    data() {
        return {
            form: {
                prompt: 'add the cat in the image',
                style: "none"
            },
            prediction_output: null,
            empty_prompt: false,
            empty_image: false,
            prediction_api_url: "/api/image-request",
            showoutputs: false,
            loader1: false,
            loader2: false,
            waitingText: true,
            selectedFile: null,
            buttonText: "Upload Image",
            selectedImage: null,
            message: null,
            showMessage:false,
            watermarked_images:[],
            logoSrc:"data:image/png;base64,",
            dimentions:[]
        };
    },
    mounted() {
        // console.log("Component mounted.");
    },
    components: {
    },
    beforeCreate() {
        // console.log("Component before create.");
    },
    methods: {
        handleFileChange(event) {
            this.selectedFile = event.target.files[0];
            this.selectedImage = URL.createObjectURL(this.selectedFile);
        },
        removeImage(){
            this.selectedImage = null;
        },
        submitForm: async function () {
            this.prediction_output = null;
            this.message = null;
            const config = {
                headers: { Accept: 'application/json' },
            };

            const body = {
                steps: 40,
                width: 1024,
                height: 1024,
                seed: 0,
                cfg_scale: 5,
                samples: 1,
                text_prompts: [
                    {
                        "text": this.form.prompt,
                        "weight": 1
                    }
                ],
            };
            if (this.form.style !== 'none') {
              body.style_preset = this.form.style;
            }
            //--------------- first api call loader here -------------//
            if(this.form.prompt == "" || this.form.prompt == null){
                this.empty_prompt = true;
                setTimeout(() => {
                    this.empty_prompt = false;
                }, 2000);
            } else {
                this.showoutputs = false;
                this.waitingText = false;
                this.loader1 = true;

                await axios
                    .post(this.prediction_api_url, body, config)
                    .then((response) => {
                        if (response.data.success == true) {
                            // response.data.artifacts.forEach(element => {
                            //     this.addWaterMark(element.base64);
                            // });
                            this.prediction_output = response.data.artifacts;
                            this.loader1 = false;
                            this.showoutputs = true;
                        }

                        if (response.data.success == false) {
                            this.loader1 = false;
                            this.showMessage = true;
                            this.message = response.data.message;
                            // console.log(response);
                            setTimeout(() => {
                                this.message = null;
                                this.showMessage = false;
                            }, 9000);
                        }
                    });
                // } catch (error) {
                //     this.loader1 = false;
                //     this.showMessage = true;
                //     if (error.response.data.name === 'invalid_sdxl_v1_dimensions' ) {
                //         this.message = 'Resolution Error !! the allowed dimensions are 1024x1024, 1152x896, 1216x832, 1344 x 768, 1536 x 640, 640x1536, 768x1344, 832x1216';
                //     }else{
                //         this.message = error.response.data.message;
                //     }
                //     setTimeout(() => {
                //         this.message = null;
                //     }, 9000);
                // }
            }
        },

        addWaterMark:function(baseString){
            // Your base64 image string
            const base64Image = `data:image/png;base64, ${baseString}`; // Replace with your actual base64 string
            
            const base64water = this.logoSrc; // Replace with your actual base64 string

            // Create an Image object to work with the image
            const image = new Image();
            image.src = base64Image;

            // Add the watermark logo object
            const watermark = new Image();
            watermark.src = base64water;

            Promise.all([
                new Promise(resolve => image.onload = resolve),
                new Promise(resolve => watermark.onload = resolve)
            ]).then(() => {
                // Create a canvas element to draw the image on
                const canvas = document.createElement('canvas');
                canvas.width = image.width;
                canvas.height = image.height;

                // Get the 2D rendering context
                const ctx = canvas.getContext('2d');

                // Draw the image on the canvas
                ctx.drawImage(image, 0, 0);

                // Add the watermark text
                // ctx.fillStyle = 'rgba(255, 0, 0, 0.5)'; // Red with 50% opacity
                // ctx.font = '24px Arial';
                // ctx.fillText('Watermark', 10, 50); // Adjust the position as needed

                // Calculate the position to center the watermark on the image
                const x = canvas.width-150;
                const y = canvas.height-150;

                const xwidth = 100;
                const xheight = 100;

                // Draw the watermark logo on the canvas
                ctx.drawImage(watermark, x, y,xwidth,xheight);

                // Convert the canvas content back to a base64 string
                const watermarkedBase64 = canvas.toDataURL('image/png');

                // Now, 'watermarkedBase64' contains the base64 string with the watermark added.
                console.log(watermarkedBase64);
                this.watermarked_images.push(watermarkedBase64);
                console.log(this.watermarked_images);

            });

        },
        
    },
};
</script>
